import favicon from '../image/favicon.png'
import styled from 'styled-components'
import Burger from './Burger'

const Nav = styled.nav`
    border-radius: 30px;
    padding-bottom: 30px;
    padding-top: 40px;
    display: flex;
    align-items: center;
    max-width: 1350px;
    margin: 0 auto;
    border-bottom: 1px solid #000000;
    background-color: black;
    text-decoration: none;
    position: sticky;
    top: 0;

    .logo{
        margin-left: 50px;
    }
`;


const Navbar = () => {
    return ( 
        <Nav className = "navbar">
            <div className = 'logo'>
                <img src = {favicon} width = "50" alt = "logo" /> 
            </div>
            <h1>Fresherstrip</h1>
            <Burger></Burger>
        </Nav>
    );
}
 
export default Navbar;
